DROP DATABASE IF EXISTS asso_sportive;
CREATE DATABASE asso_sportive;  
USE asso_sportive;

CREATE TABLE COURSE(
    idc INT PRIMARY KEY  NOT NULL AUTO_INCREMENT,
    nom VARCHAR(50),
    mois INT,
    url VARCHAR(500),
    anneeCrea INT
);

CREATE TABLE EDITION(
    ided INT NOT NULL AUTO_INCREMENT,
    annee YEAR NOT NULL,
    idc  INT NOT NULL,
    idadr INT NOT NULL,
    nbPart INT,
    plan VARCHAR(100),
    debI DATE,
    finI DATE,
    debC DATE,
    finC DATE,
    debD DATE,
    finD DATE,
    PRIMARY KEY (ided, annee)
);

CREATE TABLE EPREUVE(
    idep INT PRIMARY KEY  NOT NULL AUTO_INCREMENT,
    nom VARCHAR(30),
    dist FLOAT,
    deniv INT,
    type VARCHAR(50)
);


CREATE TABLE TARIFS(
    idep INT NOT NULL,
    ided INT NOT NULL,
    age INT NOT NULL,
    prix INT,
    PRIMARY KEY(idep, ided, age)
);

CREATE TABLE adherent(
    ida INT PRIMARY KEY  NOT NULL AUTO_INCREMENT,
    nom VARCHAR(20),
    prenom VARCHAR(20),
    dateNaissance DATE,
    sexe CHAR(1),
    idadr INT NOT NULL,
    dateCertif DATE,
    club VARCHAR(50)    
);

CREATE TABLE ADRESSE (
    idadr INT PRIMARY KEY  NOT NULL AUTO_INCREMENT,
    rue VARCHAR(50),
    codePost INT,
    ville VARCHAR(20)
);


CREATE TABLE RESULTAT(
    ided INT NOT NULL,
    dossard INT NOT NULL,
    rang INT,
    nom VARCHAR(20),
    prenom VARCHAR(20),
    sexe CHAR(1),
    PRIMARY KEY (ided, dossard)
);


CREATE TABLE TpsPASSAGE(
    ided INT NOT NULL,
    dossard INT NOT NULL,
    km FLOAT,
    temps FLOAT,
    PRIMARY KEY(ided, dossard, km)
);

CREATE TABLE IDENTIFICATION(
    ida INT,
    statut CHAR(3),
    identifiant VARCHAR(20) PRIMARY KEY  NOT NULL,
    mdp VARCHAR(20)
);

ALTER TABLE ADHERENT AUTO_INCREMENT = 2019001;

ALTER TABLE EDITION ADD CONSTRAINT fk_edition_course FOREIGN KEY (idc) REFERENCES COURSE(idc) ON DELETE CASCADE ON UPDATE CASCADE;
ALTER TABLE EDITION ADD CONSTRAINT fk_edition_adresse FOREIGN KEY (idadr) REFERENCES ADRESSE(idadr) ON DELETE CASCADE ON UPDATE CASCADE;
ALTER TABLE TARIFS ADD CONSTRAINT fk_tarifs_edition FOREIGN KEY (ided) REFERENCES EDITION(ided) ON DELETE CASCADE ON UPDATE CASCADE;
ALTER TABLE TARIFS ADD CONSTRAINT fk_tarifs_epreuve FOREIGN KEY (idep) REFERENCES EPREUVE(idep) ON DELETE CASCADE ON UPDATE CASCADE;
ALTER TABLE ADHERENT ADD CONSTRAINT fk_adherent_adresse FOREIGN KEY (idadr) REFERENCES ADRESSE(idadr) ON DELETE CASCADE ON UPDATE CASCADE;
ALTER TABLE RESULTAT ADD CONSTRAINT fk_resultat_edition FOREIGN KEY (ided) REFERENCES EDITION(ided) ON DELETE CASCADE ON UPDATE CASCADE;
ALTER TABLE TpsPASSAGE ADD CONSTRAINT fk_tpspassage_resultat FOREIGN KEY (ided, dossard) REFERENCES RESULTAT(ided, dossard) ON DELETE CASCADE ON UPDATE CASCADE;
ALTER TABLE IDENTIFICATION ADD CONSTRAINT fk_identification_adherent FOREIGN KEY (ida) REFERENCES ADHERENT(ida) ON DELETE CASCADE ON UPDATE CASCADE;


